import React from "react";
import PropTypes from 'prop-types'
import {Link} from "react-router-dom";

const headingStyle = {
    color: 'blue',
};

const Header = (props) => {
    return (
        <div className="pos-f-t">
            <div className="collapse" id="collapsedContent">
                <div className="bg-dark p-4">
                    
                </div>
            </div>
            <nav className="navbar navbar-dark bg-dark">
                <div className="container">
                    <a href="/" className="navbar-brand">
                        Athletes
                    </a>
                </div>
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#collapsedContent" aria-controls="navbarToggleExternalContent"
                    aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
            </nav>
        </div>
    );
};

// Header.defaultProps = {
//     turvataso: "pieni",
// }

// Header.propTypes = {
//     turvataso: PropTypes.string.isRequired,
// };

export default Header;
